}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16">  <g>    <path d="M13,3V0H0V13H3v3H16V3ZM1,12V1H12V3H3v9Zm14,3H4V4H15Z" fill="#3296b9"/>    <polygon points="9 13 10 13 10 10 13 10 13 9 10 9 10 6 9 6 9 9 6 9 6 10 9 10 9 13" fill="#3296b9"/>  </g></svg>';
